script: |
  super -f text -I q2333.spq | sort > q2333.out

inputs:
  - name: q2333.spq
    data: |
      SELECT DISTINCT - cor1.col0 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q2333.out
    data: |
      -3
      -64
      -80
